    "2013-03-16T00:01:40.913897",nt"name": "tennessee-borehole-lithology-intervals",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains borehole lithology
    interval observations compiled by the Tennessee Division of Geology, and published
    as a Web feature service for the National Geothermal Data System. Fields in the
    Borehole Lithology Interval Content Model will become XML elements in interchange
    documents for WMS simple features provided by a node in the USGIN network. Each
    feature includes a well name, well type, and top and bottom logged interval as well
    as Latitude and Longitude spatially referenced to EPSG: 4326 (for interoperability).
    The data contained in the submitted dataset is available as an Excel Spreadsheet,
    ESRI service, WMS and WFS service. Link to Borehole Lithology Interval Content Model:
    http://stategeothermaldata.org/data_delivery/content_models/lithology_interval_log_feature.
